#include <iostream>
#include <vector>
#include <cmath>
#include <string>

using namespace std;

class Solution{
public:
	//void help(int a, int b, vector<string>& board){
	void help(int a, int b, vector<vector<char>>& board){
		if(board[a][b] != 'O') return;
		vector<int> memo;
		memo.push_back(a);
		memo.push_back(b);
		while(!memo.empty()){
			int bb = memo.back();
			memo.pop_back();
			int aa = memo.back();
			memo.pop_back();
//note the sequence of aa and bb here because we are using
//vector as a stack here
	
			board[aa][bb] = 'S';
			if(aa > 0 && board[aa - 1][bb] == 'O'){
				memo.push_back(aa - 1);
				memo.push_back(bb);
			}
			if(aa < ((int)board.size() - 1) && board[aa + 1][bb] == 'O'){
				memo.push_back(aa + 1);
				memo.push_back(bb);
			}
			if(bb > 0 && board[aa][bb - 1] == 'O'){
				memo.push_back(aa);
				memo.push_back(bb - 1);
			}
			if(bb < ((int)board[0].size() - 1) && board[aa][bb + 1] == 'O'){
				memo.push_back(aa);
				memo.push_back(bb + 1);
			}
		}
	}
    //void solve(vector<string> &board){
    void solve(vector<vector<char>> &board){
		if(board.empty()) return;
		int size1 = (int)board.size();
		int size2 = (int)board[0].size();
		if(size1 == 1 || size2 == 1) return;
		
		for(int i = 0; i < size2 - 1; i++){
			help(0, i, board);
		}
		for(int i = 0; i < size1 - 1; i++){
			help(i, size2 - 1, board);
		}
		for(int i = 0; i < size2 - 1; i++){
			help(size1 - 1, size2 - 1 - i, board);
		}
		for(int i = 0; i < size1 - 1; i++){
			help(size1 - 1 - i, 0, board);
		}
		for(int i = 0; i < size1; i++){
			for(int j = 0; j < size2; j++){
				if(board[i][j] == 'O') board[i][j] = 'X';
				if(board[i][j] == 'S') board[i][j] = 'O';
			}
		}
	}
};

